import * as React from 'react';
import {
  Box,
  Container,
  Typography,
  Paper,
  Grid,
  Avatar,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableRow,
  useTheme,
  useMediaQuery,
} from '@mui/material';

// Beispieldaten für die Teams
const teamsData = [
  {
    id: 1,
    name: 'Rakete Freiburg',
    logoColor: '#D32F2F',
    contact: 'kontakt@rakete-freiburg.de',
    memberSince: '2010',
  },
  {
    id: 2,
    name: 'Lokomotive Littenweiler',
    logoColor: '#5D4037',
    contact: 'info@lok-littenweiler.de',
    memberSince: '2012',
  },
  {
    id: 3,
    name: 'Die 2. Wahl',
    logoColor: '#757575',
    contact: 'team@diezweite-wahl.com',
    memberSince: '2015',
  },
  {
    id: 4,
    name: 'Wurschtwecklebombers',
    logoColor: '#00796B',
    contact: 'kapitaen@ww-bombers.net',
    memberSince: '2011',
  },
];

// Sub-Komponente für eine einzelne Team-Karte
const TeamCard = ({ team }) => {
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));

  return (
    <Paper
      sx={{
        p: { xs: 2, sm: 3 },
        backgroundColor: '#1C1C1C',
        borderRadius: theme.shape.borderRadius,
        border: `1px solid ${theme.palette.grey[800]}`,
        width: '100%',
      }}
    >
      <Grid container spacing={isMobile ? 2 : 3} alignItems="center">
        {/* Linke Spalte: Logo */}
        <Grid item xs={12} sm={4} sx={{ display: 'flex', justifyContent: 'center' }}>
          <Avatar
            sx={{
              width: { xs: 80, sm: 120 },
              height: { xs: 80, sm: 120 },
              backgroundColor: team.logoColor,
              color: theme.palette.getContrastText(team.logoColor),
              fontSize: { xs: '2.5rem', sm: '4rem' },
              fontFamily: 'comfortaa',
              fontWeight: 'bold',
            }}
          >
            {team.name.substring(0, 1).toUpperCase()}
          </Avatar>
        </Grid>

        {/* Rechte Spalte: Team-Daten als Tabelle */}
        <Grid item xs={12} sm={8}>
          <TableContainer>
            <Table aria-label={`Daten für ${team.name}`}>
              <TableBody>
                <TableRow>
                  <TableCell sx={{ fontFamily: 'comfortaa', fontWeight: 600, color: theme.palette.grey[200], border: 'none', p: 1, width: '35%' }}>Teamname:</TableCell>
                  <TableCell sx={{ fontFamily: 'comfortaa', color: theme.palette.grey[300], border: 'none', p: 1 }}>{team.name}</TableCell>
                </TableRow>
                <TableRow>
                  <TableCell sx={{ fontFamily: 'comfortaa', fontWeight: 600, color: theme.palette.grey[200], border: 'none', p: 1 }}>Kontakt:</TableCell>
                  <TableCell sx={{ fontFamily: 'comfortaa', color: theme.palette.grey[300], border: 'none', p: 1, wordBreak: 'break-all' }}>{team.contact}</TableCell>
                </TableRow>
                <TableRow>
                  <TableCell sx={{ fontFamily: 'comfortaa', fontWeight: 600, color: theme.palette.grey[200], border: 'none', p: 1 }}>Mitglied seit:</TableCell>
                  <TableCell sx={{ fontFamily: 'comfortaa', color: theme.palette.grey[300], border: 'none', p: 1 }}>{team.memberSince}</TableCell>
                </TableRow>
              </TableBody>
            </Table>
          </TableContainer>
        </Grid>
      </Grid>
    </Paper>
  );
};


const TeamPage = () => {
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));

  return (
    <Container maxWidth="md" sx={{ my: 4, px: isMobile ? 2 : 3 }}>
      <Typography
        variant={isMobile ? 'h4' : 'h3'}
        component="h1"
        sx={{
          mb: 5,
          mt: 2,
          color: '#00A99D',
          fontWeight: 700,
          fontFamily: 'comfortaa',
          textAlign: 'center',
          textTransform: 'uppercase',
          letterSpacing: '0.1em',
        }}
      >
        Teams
      </Typography>
      
      <Box sx={{ display: 'flex', flexDirection: 'column', gap: isMobile ? 3 : 4 }}>
        {teamsData.map((team) => (
          <TeamCard key={team.id} team={team} />
        ))}
      </Box>
    </Container>
  );
};

export default TeamPage;
